            </div>
            <div>
              <input type="submit" value="Login" />
              {/* <Link href="/register"> */}
                <button onClick={this.signUp()}>Register</button>
              {/* </Link> */}
            </div>
          </form>
        </div>
      </App>
    );
  }
}
